import React, { Component } from "react";

export default class CurrentWeather extends Component {
  render() {
    return (
      <div>
        <div className="current-weather__container">
          <h3 className="current-weather__city">City</h3>
          <div className="current-weather__tempt">
            <img />
            <h2>19.0</h2>
          </div>
          <span className="current-weather__text">Patchy rain</span>
          <span className="current-weather__date">2019-06-05</span>
        </div>
      </div>
    );
  }
}
